import logo from './logo.svg';
import './App.css';

const document_data = [
  "/h1 Parchment v0",
  "Let's see if this works",
]

function App() {
  return (
    <div className="App">
      {
        document_data.map(line => {
          console.log(line);
          return display(line)
        })
      }
    </div>
  );
}

const display = (line) => {
  if(line.split(" ")[0] === '/h1') {
    console.log(line.split(" "));
    return (<h1>{ line }</h1>)
  } else {
    return (<p>{ line }</p>)
  }
}

export default App;
